import React from 'react'
import SearchBar from './SearchBar'
function Nav({title, src}) {
    return (
        <div>
            <img style={{fontSize: '14px'}} src={src} alt="" />
            <h2>{title}</h2>
            <SearchBar onSearch={(ciudad) => alert(ciudad)} />
        </div>
    )
}

export default Nav
